import React from "react";

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light mt-3">
      <div className="container-fluid px-4 ">
        <a className="btn btn-secondary ms-3" href="#">Doggo</a>
        <div className="ml-auto d-flex">
          <a className="btn btn-secondary bg-gray mx-2" href="#">List</a>
          <a className="btn btn-secondary bg-gray mx-2" href="#">Track</a>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
